ctrl.post('/addBulkSkill', function (req, res) {
    var Skill = require('../models/skill');
    var skill = [];
    var promiseArr = [];
    if (req.session.passport && req.session.passport.type == 2) {
        var userId = req.session.passport.user;
        upload(req, res, function (err) {
            if (err) {
                return
            }
            var ext = req.file.originalname.split('.').pop();
            filename = userId + '.' + ext;

            var uploadpath = path.resolve(__dirname, "../../../client/app/public/files/CSVfiles/");
            var CSVpath = uploadpath + '/' + filename;
            fs.writeFile(uploadpath + '/' + filename, req.file.buffer, function (err) {
                if (err) {
                    return console.log(err);
                }

                fs.createReadStream(CSVpath)
                    .pipe(csv())
                    .on('data', function (data) {
                        var newdata = data.toString();
                        var skillDefer = Q.defer();
                        Skill.findOne({ title: newdata }, function (err, findskills) {
                            if (err)
                                skillDefer.reject(err);
                            if (!findskills) {
                                Skill.create({ "title": newdata }, function (err, insertData) {
                                    if (err)
                                        skillDefer.reject(err);
                                    skillDefer.resolve();
                                });
                            } else {
                                skillDefer.resolve();
                            }
                        });
                        promiseArr.push(skillDefer);
                    })
                    .on('end', function (data) {
                        Q.all(promiseArr).then(function () {
                            res.json({ 'data': null, 'msg': 'Bulk Upload Successful' });
                        })
                    })
            });
        });
    } else {
        console.log("User not found");
        //        data = {message: 'User not found'};
        res.json({ msg: 'User Not Found' });
    }
});



