ctrl.post('/add', function (req, res) {
    var skill = new Skill();
    var userId = req.session.passport.user;
    Skill.findOne({ 'title': req.body.name }, function (err, Subjectdata) {
        if (err) {
            throw err;
        }
        if (Subjectdata) {
            res.json({ status: 3, msg: "Skill Already Added" });
        } else {
            if (req.body.name) {
                skill.title = req.body.name;
            }
            skill.save(function (err, skill) {
                if (err)
                    throw err;
                if (skill != '') {
                    var userskills = new Userskills();
                    userskills.skill_id = skill._id;
                    userskills.user_id = userId;
                    userskills.save(function (err) {
                        if (err)
                            throw err;
                        res.json({ msg: 'Skill Added Successfully', skill: skill, status: 2 });
                    });
                }

            });
        }
    });
});
ctrl.post('/updateSkillById/:id/', function (req, res) {
    var title = req.body.name;
    var ID = req.params.id;
    Skill.findOne({ 'title': title }, function (err, Degreedata) {
        if (err) {
            throw err;
        }
        if (Degreedata) {
            res.json({ status: 3, msg: "Skill Already Added" });
        } else {
            Skill.findByIdAndUpdate(ID,
                {
                    $set: {
                        title: title,
                    }
                }, function (err, newSkl) {
                    if (err) {
                        throw err;
                    }
                    Skill.find({ _id: ID }, function (err, updSkill) {
                        if (err)
                            throw err;
                        res.json({ status: 2, message: "Skill Updated Successfully", data: updSkill });
                    });
                });
        }
    });
});
ctrl.get('/getAllSkills/:counter', function (req, res) {
    var counter = req.params.counter;
    var limit = 50;
    var skip = (counter - 1) * 50;
    Skill.find({})
        .limit(limit)
        .skip(skip)
        .exec(function (err, skills) {
            if (err)
                throw err;
            Skill.find({})
                .count()
                .exec(function (err, total_skills) {
                    if (err)
                        throw err;
                    res.json({ data: skills, total_skills: total_skills });
                });
        });

});


ctrl.post('/addSkill', function (req, res) {
    var userskills = new Userskills();
    if (req.session.passport) {
        if (req.body.id) {
            var userid = req.session.passport.user;
            Userskills.find({ user_id: userid, skill_id: req.body.id },
                function (err, skl) {
                    if (err)
                        throw err;
                    if (skl.length > 0) {
                        res.json({ status: 3, msg: "Already present" });
                    } else {
                        userskills.skill_id = req.body.id;
                        userskills.user_id = userid;
                        userskills.save(function (err) {
                            if (err)
                                throw err;
                            res.json({ status: 2, message: 'Skill added.', data: userskills });
                        });
                    }
                });
        }
    }

});

